<script>
function predict(){
	document.getElementById("out").innerText = getStupid(
  	document.getElementById("in").value,
    parseInt(document.getElementById("inten").value)
  )
}
function showVal(v){
	let o = v == 0 ? "Default" : v
	document.getElementById("intenTXT").innerText = "Intensity ("+o+"): "
}

function getRandomKey(obj) {
  const keys = Object.keys(obj);
  return keys[(keys.length * Math.random()) << 0];
}

function getRandomElement(arr) {
  return arr[Math.floor(Math.random() * arr.length)];
}

function getRandomInt(min, max) {
  return Math.floor(Math.random() * (max - min)) + min;
}

function getStupid(words, intensity){
  let out = "";
  for (const origin of words.split(" ")) {
    try {
      const possible = [];
      for (const wrd of dict_letters[
        getRandomKey(dict_letters)
      ]) {
        if (wrd.length > origin.length - 2 && wrd.length < origin.length + 2) {
          possible.push(wrd);
        }
      }
      const randSimilar = getRandomElement(possible)
      //console.log("Origin:", origin, "\tRand:", randSimilar);

      const randsLetters = [...randSimilar];
      const originSeperated = [...origin];
      for (let i = 0; i < getRandomInt(0, intensity==null || intensity==0 ? origin.length : intensity); i++) {
        const fromIndex = getRandomInt(1, randsLetters.length - 1);
        const percent = fromIndex / (randsLetters.length - 1);
        const toIndex = Math.floor(percent * origin.length);
        originSeperated.splice(toIndex, 0, randsLetters[fromIndex]);
      }
      out += originSeperated.join("") + " ";
    } catch (e) {
      //console.log(e.message);
      out += origin + " ";
    }
  }
  //console.log(out);
  return out.substring(0, out.length-1)
}
</script>
